INSERT INTO `promotioninfo` (`promotionInfo_id`, `promotionInfo_title`, `promotionInfo_image`, `promotionInfo_Description`, `promotionInfo_2ndImage`, `promotionInfo_Details`) VALUES
(1, 'Golden Village Theaters IMAX® – The Walk Contest', , 'Watch THE WALK in IMAX 3D and tell us what you love about heights! 8 winners will be picked to win 2 tickets each to MegaZip Adventure Park (worth $120).', , 'Catch THE WALK IMAX 3D (PG - Some Intense Sequences) at Golden Village Theaters Lido and JCube from Thursday, 22 Oct 2015 Watch THE WALK in IMAX 3D and tell us what you love about heights.</br></br>8 winners with the best answer will stand to win:</br><br>Two tickets each to MegaZip Adventure Park (worth $120)');
INSERT INTO `promotioninfo` (`promotionInfo_id`, `promotionInfo_title`, `promotionInfo_image`, `promotionInfo_Description`, `promotionInfo_2ndImage`, `promotionInfo_Details`) VALUES
(2, 'SAFRA Members Red Hot Weekend $8 Movie Deal ', , 'For just $8 (U.P. $12) per ticket, you and your friends can enjoy a movie together at Golden Village Theaters. Members must purchase ticket in person with valid SAFRA card and NRIC for verification. Valid for the first 2,000 discounted tickets per day (Sat and Sun). ', , '');
INSERT INTO `promotioninfo` (`promotionInfo_id`, `promotionInfo_title`, `promotionInfo_image`, `promotionInfo_Description`, `promotionInfo_2ndImage`, `promotionInfo_Details`) VALUES
(3, 'Bank of China Card Members Movie Privileges', , 'Enjoy 1-For-1 Golden Village Theaters 2D movie tickets with Bank of China World MasterCard & F1RST Card till 31 December 2015. Limited to the first 500 tickets.', , '');
INSERT INTO `promotioninfo` (`promotionInfo_id`, `promotionInfo_title`, `promotionInfo_image`, `promotionInfo_Description`, `promotionInfo_2ndImage`, `promotionInfo_Details`) VALUES
(4, 'Win PARANORMAL ACTIVITY Movie Pack', , 'Stand to win PARANORMAL ACTIVITY: THE GHOST DIMENSION movie pack when you purchase a pair of PARANORMAL ACTIVITY: THE GHOST DIMENSION (NC16) movie tickets at Golden Village Theaters! ', , 'Catch PARANORMAL ACTIVITY: THE GHOST DIMENSION (NC16 - Horror And Coarse Language) at Golden Village Theaters!</br>                                                 Stand to win a PARANORMAL ACTIVITY: THE GHOST DIMENSION movie pack when you purchase a pair of PARANORMAL ACTIVITY: THE GHOST DIMENSION (NC16) movie tickets at Golden Village Theaters!</br>                                                 Enter the draw and fill up your particulars below.</br></br>                                                  5 winners with the best answer will stand to win:</br>                                                 - a Fish-eye blue haze effect phone camera lens<br>                                                 - a Self-stirring mug<br>                                                 - a Photo reactive t-shirt');
INSERT INTO `promotioninfo` (`promotionInfo_id`, `promotionInfo_title`, `promotionInfo_image`, `promotionInfo_Description`, `promotionInfo_2ndImage`, `promotionInfo_Details`) VALUES
(5, 'Zombie Parkour Evasion CINIME Gameplay', , 'Play the Zombie Parkour Evasion in Golden Village Theaters today. Stand a chance to win Go Pro Hero 4 Cameras, Travel Vouchers and many more fantastic prizes weekly!', , 'Download the CINIME app and play the Zombie Parkour Evasion in Golden Village Theaters today.  Stand a chance to win Go Pro Hero 4 Cameras, Travel Vouchers and many more fantastic prizes weekly!\r\n\r\n                                                </br>Simply guess the correct route, parkour of rooftops to try escape the zombies &  get to the safe site! \r\n                                                </br>Submit your competition entry with your email address at the end of the game to qualify.\r\n\r\n                                                </br></br>Weekly prizes up for grabs!');
INSERT INTO `promotioninfo` (`promotionInfo_id`, `promotionInfo_title`, `promotionInfo_image`, `promotionInfo_Description`, `promotionInfo_2ndImage`, `promotionInfo_Details`) VALUES
(6, 'Watch REALD 3D Movies & Win Movie T-shirts', , 'Stand to win Movie T-shirts when you purchase a pair of 3D film movie tickets at Golden Village Theaters.', , 'From Thursday, 26 Nov 2015 to 4 January 2016, catch any 3D films at Golden Village Theaters!</br>                                                 You stand to win movie t-shirts when you purchase a pair of 3D film movie tickets at Golden Village Theaters!</br>                                                  Enter the draw and fill up your particulars below.</br>                                                  Winners with the best answer will stand to win: </br></br>Two(2) Movie T-shirts (Kid''s size) each</p>');
